sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.status = inputs.status;
  if (inputs.status == 'success') {
    try {
      //Parse stringified JSON to JS Object
      outputs.response = JSON.parse(inputs.sapresponse);

      //Retrieve SAP execution errors if any and update status
      var errStatusObj = SapEccUtil.getReturnErrors(outputs.response);
      outputs.status = errStatusObj.status;
      outputs.err = errStatusObj.err;
    } catch (e) {
      var errStatObj = SapEccUtil.getUnknownErr(e);
      outputs.status = errStatObj.status;
      outputs.err = errStatObj.err;
    }
  }
})(inputs, outputs);

(function execute(inputs, outputs) {
  try {
    //Validate mandatory fields
    var mandatoryFields = {
      "Transaction Code for Goods Movement": inputs.code,
      "Material Document Header > Posting Date": inputs.header.PSTNG_DATE,
      "Material Document Header > Reference [ REF_DOC_NO ]": inputs.header.REF_DOC_NO
    };

    var itemdata = inputs.item;
    /*if(JSUtil.notNil(itemdata)) {
      for(var index =0; index < itemdata.length; ++index) {
        var itemElement = 'Material Document Items [' + (index+1) +']';
        mandatoryFields[itemElement + ' > Material'] = itemdata[index].MATERIAL;
        mandatoryFields[itemElement + ' > Plant'] = itemdata[index].PLANT;
        mandatoryFields[itemElement + ' > Storage Location'] = itemdata[index].STGE_LOC;
        mandatoryFields[itemElement + ' > Movement type'] = itemdata[index].MOVE_TYPE;
        mandatoryFields[itemElement + ' > Vendor'] = itemdata[index].VENDOR;
        mandatoryFields[itemElement + ' > Qty in unit of entry'] = itemdata[index].ENTRY_QNT;
        mandatoryFields[itemElement + ' > Purchase order'] = itemdata[index].PO_NUMBER;
        mandatoryFields[itemElement + ' > Item'] = itemdata[index].PO_ITEM;
        mandatoryFields[itemElement + ' > Movement indicator'] = itemdata[index].MVT_IND;
      }
    }*/

    var emptyFields = SapEccUtil.checkMandatoryFields(mandatoryFields);
    if(JSUtil.nil(itemdata) || JSUtil.isEmpty(itemdata)) {
      emptyFields.push('Material Document Items');
    }
    if (JSUtil.notNil(emptyFields)) {
      throw 'Mandatory field(s) '.concat(emptyFields)+' cannot be blank.';
    }

    var info = SapEccUtil.getConnectionFromAlias(inputs.alias_id);
    outputs.conn_host = info.getAttribute("host");
    outputs.conn_params = info.getExtendedAttributes();

    var connId = info.getAttribute("sys_id");
    outputs.cred_id = SapEccUtil.getCredentialIdFromConnection(connId);

    var code = {
      GM_CODE: inputs.code
    };

    var payload = SapEccUtil.unflattenPayload(inputs.additional_in);
    payload['GOODSMVT_HEADER'] = inputs.header;
    payload['GOODSMVT_CODE'] = code;
    payload['GOODSMVT_ITEM'] = inputs.item;

    outputs.json_in = SapEccUtil.removeMetaNameField(payload);
  } catch (e) {
    throw e;
  }
})(inputs, outputs);

